function CharNames ( { teamChars }) {

    const charNames = teamChars.map((char) => {
        const strengths = char.strengths.text.map((str) => str+"\n")
        return (
            <td key={char.name} title={strengths}>{char.name}</td>
        )
    })
    return charNames
}

export default CharNames
